        d="M19.36 12.296H4.64M10.4 14.667v.592l-.64 1.186h4.48l-.64-1.186v-.592"
        stroke="currentColor"
        strokeLinecap="round"
        strokeLinejoin="round"
      />
    </svg>
  );
}

export default SvgTechnology;
